import React from "react";
import Register from '../Components/Register';
import DeleteUser from "../Components/DeleteUser";
import CreateUnit from "../Components/CreateUnit";
import DeleteUnit from "../Components/DeleteUnit";
import LogoutButton from "../Components/LogoutButton";
import "../Style.css";

export default function Admin() {

    return (
        <div className="admin-container">
            <h1>AdminPage</h1>
            <Register className="admin-button" />
            <DeleteUser className="admin-button" />
            <CreateUnit className="admin-button" />
            <DeleteUnit className="admin-button" />
            <LogoutButton className="admin-button" />
        </div>
    );
}
